export const Header = () => {
  return (
    <header className='header'>
        <div>
            <img id='logo' src={logo}></img>
            <h1 className='title'>ShopMo</h1>
        </div>
        <div>

                 <h3>categorias  <FontAwesomeIcon icon={faCaretDown} /></h3> 
            <input type="text" placeholder='Buscar'/>
        </div>
    </header>
  )
}
